public class TFTPReadRequestPacketTest1 {

    @Test
    public void testExtractProtocolOptionsFromReadRequestPacket() throws UnknownHostException, TFTPPacketException {
        // Step 1: Create a DatagramPacket with a properly formatted TFTP read request
        DatagramPacket datagramPacket = createTFTPReadRequestDatagramPacket();

        // Step 2: Construct a TFTP Read Request Packet instance
        TFTPReadRequestPacket requestPacket = new TFTPReadRequestPacket(datagramPacket);

        // Step 3: Verify the string representation is non-null
        String packetString = requestPacket.toString();
        assertNotNull(packetString, "Packet string representation should not be null");

        // Step 4: Retrieve the options map from the request packet
        Map<String, String> optionsMap = requestPacket.getOptions();

        // Step 5: Assert that the options map contains exactly one entry
        assertEquals(1, optionsMap.size(), "Options map should contain exactly one entry");

        // Step 6: Confirm that the "blksize" key returns the expected value "1024"
        assertEquals("1024", optionsMap.get("blksize"), "Block size should be 1024");
    }

    private DatagramPacket createTFTPReadRequestDatagramPacket() throws UnknownHostException {
        // TFTP opcode for read request: 0x0001
        byte[] opcode = new byte[]{0x00, 0x01};

        // File name: "test.txt" followed by null terminator
        byte[] fileName = "test.txt\0".getBytes();

        // Mode: "octet" followed by null terminator
        byte[] mode = "octet\0".getBytes();

        // Block size option: "blksize\01024\0"
        byte[] blockSizeOption = "blksize\01024\0".getBytes();

        // Combine all parts into a single byte array
        byte[] packetData = new byte[opcode.length + fileName.length + mode.length + blockSizeOption.length];
        System.arraycopy(opcode, 0, packetData, 0, opcode.length);
        System.arraycopy(fileName, 0, packetData, opcode.length, fileName.length);
        System.arraycopy(mode, 0, packetData, opcode.length + fileName.length, mode.length);
        System.arraycopy(blockSizeOption, 0, packetData, opcode.length + fileName.length + mode.length, blockSizeOption.length);

        // Create a DatagramPacket with the constructed data
        return new DatagramPacket(packetData, packetData.length, InetAddress.getByName("127.0.0.1"), 69);
    }
}

