public class TFTPReadRequestPacketTest1 {

    @Test
    public void testDatagramReconstruction() throws UnknownHostException, TFTPPacketException {
        // Step 1: Create a helper method to construct a properly formatted TFTP read request datagram
        DatagramPacket initialDatagramPacket = createTFTPReadRequestDatagram();

        // Step 2: Invoke the helper method to obtain an initial datagram packet
        // Already done in step 1

        // Step 3: Construct a TFTP Read Request Packet instance by parsing the initial datagram
        TFTPReadRequestPacket requestPacket = (TFTPReadRequestPacket) TFTPPacket.newTFTPPacket(initialDatagramPacket);

        // Step 4: Call the parameterless newDatagram method on the request packet
        DatagramPacket reconstructedDatagram = requestPacket.newDatagram();

        // Step 5: Verify that the reconstructed datagram is not null
        assertNotNull(reconstructedDatagram);

        // Step 6: Assert that the reconstructed datagram's network address, port, length, and byte data match the original datagram's corresponding properties
        assertEquals(initialDatagramPacket.getAddress(), reconstructedDatagram.getAddress());
        assertEquals(initialDatagramPacket.getPort(), reconstructedDatagram.getPort());
        assertEquals(initialDatagramPacket.getLength(), reconstructedDatagram.getLength());
        assertArrayEquals(initialDatagramPacket.getData(), reconstructedDatagram.getData());

        // Step 7: Allocate a byte array sized to match the original datagram's length
        byte[] byteBuffer = new byte[initialDatagramPacket.getLength()];

        // Step 8: Construct a new datagram packet targeting localhost with the byte buffer
        DatagramPacket newDatagramPacket = new DatagramPacket(byteBuffer, byteBuffer.length, InetAddress.getLocalHost(), initialDatagramPacket.getPort());

        // Step 9: Invoke the two-parameter newDatagram method on the request packet with the new datagram packet and byte buffer
        DatagramPacket secondReconstructedDatagram = requestPacket.newDatagram(newDatagramPacket, byteBuffer);

        // Step 10: Verify that the second reconstructed datagram's address and port match the original datagram's network properties
        assertEquals(initialDatagramPacket.getAddress(), secondReconstructedDatagram.getAddress());
        assertEquals(initialDatagramPacket.getPort(), secondReconstructedDatagram.getPort());

        // Step 11: Confirm that the byte buffer contains identical data to the original datagram's payload
        assertArrayEquals(initialDatagramPacket.getData(), byteBuffer);
    }

    private DatagramPacket createTFTPReadRequestDatagram() throws UnknownHostException {
        // Construct a properly formatted TFTP read request datagram
        String filename = "testfile.txt";
        String mode = "octet";

        // Calculate the size of the datagram payload
        int payloadSize = 2 + filename.length() + 1 + mode.length() + 1;
        byte[] payload = new byte[payloadSize];

        int offset = 0;
        // Opcode (2 bytes, value 1 for read request)
        payload[offset++] = 0;
        payload[offset++] = 1;

        // Filename (null-terminated string)
        System.arraycopy(filename.getBytes(), 0, payload, offset, filename.length());
        offset += filename.length();
        payload[offset++] = 0;

        // Mode (null-terminated string)
        System.arraycopy(mode.getBytes(), 0, payload, offset, mode.length());
        offset += mode.length();
        payload[offset++] = 0;

        // Create a datagram packet with the payload
        return new DatagramPacket(payload, payload.length, InetAddress.getLocalHost(), 69);
    }
}

