        System.arraycopy(transmissionPacket.getData(), 0, packetData, 0, transmissionPacket.getLength());
        assertArrayEquals(originalContent, packetData);

        // Step 6: Prepare a fresh packet structure with buffer space allocated
        DatagramPacket freshPacketStructure = new DatagramPacket(new byte[1024], 1024);

